(5045, 4, 'simple', NULL, '2015-08-12 12:30:31', NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'NewU White Cotton Balls 50s', NULL, NULL, '75.0000', NULL, NULL, NULL, 0, NULL, '<p><strong>Cotton Balls</strong></p>\r\n<p>Super soft, natural and hygienic, the cotton balls from NewU are all you need for cleansing, toning and oiling purposes.</p>\r\n<p>They are made keeping in mind the skin sensitivity levels and can become an ideal choice for regular make-up users.</p>\r\n<p>These are fairly priced and far better than the other products in the range.</p>', '30049983', NULL, '/3/0/30049983.jpg', NULL, NULL, NULL, NULL, 0, '/3/0/30049983.jpg', NULL, '2015-08-12 12:30:31', 'newu-white-cotton-balls-50s', 'newu-white-cotton-balls-50s.html', 4, '0.0000', NULL, NULL, NULL, NULL, NULL, 6272, 'NewU'),
(5046, 4, 'simple', NULL, '2015-08-12 12:34:11', NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'NewU Mixed Color Cotton Balls 50s', NULL, NULL, '75.0000', NULL, NULL, NULL, 0, NULL, '<p><strong>Cotton Balls &ndash; Colored</strong></p>\r\n<p>Finest quality and natural cotton was put into the making of these soft and pure colored cotton balls from NewU. They come as a handy option for cleansing, toning and daily moisturizing routine. Be it removing make-up or nail polish, this is all what you need. This is the most hygienic option for you.</p>', '30049984', NULL, '/3/0/30049984.jpg', NULL, NULL, NULL, NULL, 0, '/3/0/30049984.jpg', NULL, '2015-08-12 12:34:11', 'newu-mixed-color-cotton-balls-50s', 'newu-mixed-color-cotton-balls-50s.html', 4, '0.0000', NULL, NULL, NULL, NULL, NULL, 6272, 'NewU'),
(5047, 4, 'simple', NULL, '2015-08-12 12:40:06', NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'NewU Cotton Buds 100s', NULL, NULL, '60.0000', NULL, NULL, NULL, 0, NULL, '<p>Made from finest quality cotton, the ear buds from NewU are super soft and hygienic. The sticks are stronger that provide good grip and quick cleaning results. Untouched by hands, this should be your first choice when thinking of getting a genuine product.</p>', '30049985', NULL, '/3/0/30049985.jpg', NULL, NULL, NULL, NULL, 0, '/3/0/30049985.jpg', NULL, '2015-08-12 12:40:06', 'newu-cotton-buds-100s', 'newu-cotton-buds-100s.html', 4, '0.0000', NULL, NULL, NULL, NULL, NULL, 6272, 'NewU'),
(5048, 4, 'simple', NULL, '2015-08-12 12:42:56', NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, '4', 2, 'NewU Cotton RoundPads 50s', NULL, NULL, '99.0000', NULL, NULL, NULL, 0, NULL, '<p>Stable, highly absorbent and 100% natural are a few factors that define the quality Cotton Pads from NewU. They are a convenient method for applying lotions, removing make-up, nail paint and putting on creams. The cotton pads are designed to optimally absorb liquids that ensure no dripping to make the process neat and clean.&nbsp;</p>', '30049986', NULL, '/3/0/30049986.jpg', NULL, NULL, NULL, NULL, 0, '/3/0/30049986.jpg', NULL, '2015-08-12 12:42:56', 'newu-cotton-round-pads-50s', 'newu-cotton-round-pads-50s.html', 4, '0.0000', NULL, NULL, NULL, NULL, NULL, 6272, 'NewU'),
